import React from 'react';
import { useNavigate } from 'react-router-dom';
import { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import { Prev } from 'react-bootstrap/esm/PageItem';

const Signup = () =>{
  const[data, setData] = useState({username:'',email:''
                                  ,password:'',password2:''
                                  ,name:'',gender:''
                                  ,age:'',place:''
                                  ,prefix:'',phone:''});
  
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [password2, setPassword2] = useState('');
  const [name, setName] = useState('');
  const [gender, setGender] = useState('')
  const [age, setAge] = useState('');
  const [place, setPlace] = useState('');
  const [prefix, setPrefix] = useState('')
  const [phone, setPhone] = useState('')

  const [userDetails, setUserDetails] = useState(null);

  let navigate = useNavigate();

  useEffect(() => {
    setUserDetails({ username, email, password, password2, name, gender, age, place, prefix, phone });
  }, [username, email, password, password2, name, gender, age, place, prefix, phone]);

  const handleUsernameChange = (event) => {
    setUsername(event.target.value);
  }
  
  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  }
  
  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  }
  
  const handlePassword2Change = (event) => {
    setPassword2(event.target.value);
  }
  
  const handleNameChange = (event) => {
    setName(event.target.value);
  }
  
  const handleGenderChange = (event) => {
    setGender(event.target.value);
  }

  const handleAgeChange = (event) => {
    setAge(event.target.value);
  }

  const handlePlaceChange = (event) => {
    setPlace(event.target.value);
  }

  const handlePrefixChange = (event) => {
    setPrefix(event.target.value);
  }

  const handlePhoneChange = (event) => {
    setPhone(event.target.value);
  }

  const handleSubmit = (event) => {
    event.preventDefault();
    axios.post('http://127.0.0.1:8000/myapp/accounts', data)
      .then(response => {
        console.log(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }

  const handleChange = (e, myKey) =>{
    setData(prevdata=>({...prevdata, [myKey]:e.target.value}))    
  }
  useEffect(()=>{console.log(data)} ,[data])
  

    return (
    <div>
      <form onSubmit={handleSubmit}>
      {/* <label>
            User name:
          <input type="text" value={data.useramedemo} onChange={(e)=>{handleChange(e,'username')}} />
        </label>
        <br />
        <label>
            email:
          <input type="text" value={data.emaildemo} onChange={(e)=>{handleChange(e,'email')}} />
        </label>
        <br />
        <label>
            User name:
          <input type="text" value={data.password} onChange={(e)=>{handleChange(e,'password')}} />
        </label>
        <br />
        <label>
            email:
          <input type="text" value={data.password2} onChange={(e)=>{handleChange(e,'password2')}} />
        </label>
        <br />
        <label>
            User name:
          <input type="text" value={data.name} onChange={(e)=>{handleChange(e,'name')}} />
        </label>
        <br />
        <label>
            email:
          <input type="text" value={data.emaildemo} onChange={(e)=>{handleChange(e,'email')}} />
        </label>
        <br /> */}
        
        
        
        
        
        <label>
            User name:
          <input type="text" value={data.username} onChange={(e)=>{handleChange(e,'username')}}  />
        </label>
        <br />
        <label>
            Email:
          <input type="email" value={data.email} onChange={(e)=>{handleChange(e,'email')}} />
        </label>
        <br />
        <label>
            Password:
          <input type="text" value={data.password} onChange={(e)=>{handleChange(e,'password')}}  />
        </label>
        <br />
        <label>
            Password:
          <input type="text" value={data.password2} onChange={(e)=>{handleChange(e,'password2')}} />
        </label>
        <br />
        <label>
            Name:
          <input type="text" value={data.name} onChange={(e)=>{handleChange(e,'name')}}  />
        </label>
        <br />
        <label>
            Gender:
          <input type="text" value={data.gender}onChange={(e)=>{handleChange(e,'gender')}}  />
        </label>
        <br />
        <label>
            Age:
          <input type="text" value={data.age} onChange={(e)=>{handleChange(e,'age')}}  />
        </label>
        <br />
        <label>
            Place:
          <input type="text" value={data.place} onChange={(e)=>{handleChange(e,'place')}}  />
        </label>
        <br />
        <label>
            prefix:
          <input type="tel" value={data.prefix} onChange={(e)=>{handleChange(e,'prefix')}}  />
        </label>
        <br />
        <label>
            Phone:
          <input type="tel" value={data.phone} onChange={(e)=>{handleChange(e,'phone')}}  />
        </label>
        <br />
        
        <button type="submit">Submit</button>
      </form>
      <button onClick={()=>navigate("/")}>Back Home</button>
    </div>
  );
}

export default Signup;
